class Solution(object):
    def findMaxConsecutiveOnes(self, nums):
        max_till_now = 0
        max_ones = 0
        for i in range(len(nums)):
            if nums[i] == 1:
                max_ones = max_ones + 1
                
            else:
                if max_ones > max_till_now:
                    max_till_now = max_ones
                max_ones = 0

        return max(max_ones, max_till_now)

